import React from 'react';

class Task extends React.Component {
    render() {
        return (
            <div className="task">
                <p>{this.props.name}</p>
                <p>{this.props.key}</p>
                <p>{this.props.completed}</p>
                <button className="delete-task button">Delete</button>
                <button className="complete-task button">Complete</button>
            </div>
        );
    }
}

export default Task;
